    const InputEvent =(event)=>{
     
        SetItemInput(event.target.value)
        
    }
return (<>

<h1>ToDo List</h1>
<br/>
<input type="text" onChange ={InputEvent} placeholder="Add Items" />
<h1>+</h1>
<br/>
<ol>
    <li>{ItemInput}</li>
</ol>
</>
)






}

export default App;
